using HECSFramework.Serialize;using System.Collections.Generic;namespace HECSFramework.Unity{	public static partial class AnimatorManager	{		public static AnimatorHelper PlayerController;		static AnimatorManager()		{			InitPlayerController();		}		private static void InitPlayerController()		{			var dictionaryPlayerController = new Dictionary<int, string>()			{				{-677724041, "Ellen_Idle"},				{-8989681, "Ellen_Walk"},				{73692710, "Ellen_Run"},			};			var resolver = new AnimatorStateResolver			{				BoolStates = new Dictionary<int,BoolParameterResolver>()				{				},				IntStates = new Dictionary<int,IntParameterResolver>()				{				},				FloatStates = new Dictionary<int,FloatParameterResolver>()				{					{-1118621987, new FloatParameterResolver() },				},			};			animStateProviders.Add("PlayerController", resolver);			PlayerController = new AnimatorHelper(dictionaryPlayerController);			animhelpers.Add("PlayerController", PlayerController);		}	}}